    }

    cadastrar(e){
        console.log();
    }

    render(){
        return(
            <div>
                <h1>Cadastrar</h1>
                <form onSubmit={this.cadastrar} id='formStation'>
                    <label>Nome: </label> <br />
                    <input type='texte' name='nmFantazy' /> <br />
                    <button>Cadastrar</button>
                </form>
            </div>
        )
    }
}
export default Register;
